$.afV=function(){var t=u.X
return P.E(["en","  ","pt","O Studying Number nasceu do conceito de cart\xf5es, onde em um lado do cart\xe3o \xe9 apresentado uma palavra e do outro o significado. H\xe1 alguns aplicativos que se prop\xf5em a fazer isto com palavras e frases, em sua maioria \xe9 voc\xea quem monta os cart\xf5es.\nO Studying Number, por ser voltado exclusivamente para n\xfameros, os cart\xf5es s\xe3o autom\xe1ticos e a op\xe7\xe3o de v\xe1rios idiomas lhe permite ampliar seus conhecimentos lingu\xedsticos.\nDe forma aleatoriamente o Studying Numbers lhe apresenta a grafia de um numeral, no idioma selecionado, para voc\xea digitar o n\xfamero (algarismos num\xe9ricos). Neste processo o n\xfamero correto \xe9 apresentado em sua foram escrita e em sua pronuncia.\nPara um desafio maior, pode-se inverter a apresenta\xe7\xe3o, ou seja, o Studying Number lhe apresenta o numeral para voc\xea escrever a grafia do mesmo.\nEm ambos os casos, o contato com o idioma, sua escrita e pronuncia lhe ajudaram a acostumar a ler a grafia e ouvir a pronuncia, identificando, por repeti\xe7\xe3o, as diferen\xe7as entre numerais decimais, centesimais e outras escalas.\n\n  "],t,t)}()
